import React from 'react';
import ReactDOM from 'react-dom';
import Card from './Card';
import './index.css';
import Sdata from './Sdata';

function ncard(val) {
  return <Card imssrc={val.imssrc} title={val.title} link={val.link} />;
}

let sdataLenth = Sdata.length;

ReactDOM.render(
  <>
    <h1> Top {sdataLenth} Netflix Web Series</h1>
    {Sdata.map(ncard)}
  </>,
  document.getElementById('root')
);
